            data = test[2]
            known_degree = test[3]
            known_delay = test[4]
            known_data = test[5]
            c = np.array(data, dtype = "float")
            ps = PeriodicSpline1D.from_spline_coeff(c, degree = degree, delay = delay)
            c = np.array(known_data, dtype = "float")
            known_bs = PeriodicSpline1D.from_spline_coeff(c, degree = known_degree, delay = known_delay)
            bs = ps.upper_bound(degree = known_degree)
            assert known_bs.degree == bs.degree
            assert known_bs.period == bs.period
            assert isclose(
                known_bs.delay,
                bs.delay,
                rel_tol = sqrt(ulp(1.0)),
                abs_tol = sqrt(ulp(1.0))
            )
            b = bs.spline_coeff
            for (k, ck) in enumerate(known_bs.spline_coeff):
                assert isclose(
                    ck,
                    b[k],
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
