    #---------------
    def test_zeros_unit_multiplicity (
        self
    ):
        #---------------
        def ivl_superset_sgl (
            z,
            known_singletons
        ):
            zero_periodized_set = set()
            for z0 in z:
                if isinstance(z0, Singleton):
                    zero_periodized_set.add(Closed((z0.value - len(c) - 0.5 * sqrt(ulp(1.0)), z0.value - len(c) + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.value - 0.5 * sqrt(ulp(1.0)), z0.value + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.value + len(c) - 0.5 * sqrt(ulp(1.0)), z0.value + len(c) + 0.5 * sqrt(ulp(1.0)))))
                elif isinstance(z0, (Open, OpenClosed, Closed, ClosedOpen)):
                    zero_periodized_set.add(Closed((z0.infimum - len(c) - 0.5 * sqrt(ulp(1.0)), z0.supremum - len(c) + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.infimum - 0.5 * sqrt(ulp(1.0)), z0.supremum + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.infimum + len(c) - 0.5 * sqrt(ulp(1.0)), z0.supremum + len(c) + 0.5 * sqrt(ulp(1.0)))))
            for s0 in known_singletons:
                if not Interval.ismember(s0, zero_periodized_set):
                    return False
            return True
        #---------------
        def ivl_superset_opn (
            z,
            known_opens
        ):
            zero_periodized_set = set()
            for z0 in z:
                if isinstance(z0, Singleton):
                    zero_periodized_set.add(Closed((z0.value - len(c) - 0.5 * sqrt(ulp(1.0)), z0.value - len(c) + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.value - 0.5 * sqrt(ulp(1.0)), z0.value + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.value + len(c) - 0.5 * sqrt(ulp(1.0)), z0.value + len(c) + 0.5 * sqrt(ulp(1.0)))))
                elif isinstance(z0, (Open, OpenClosed, Closed, ClosedOpen)):
                    zero_periodized_set.add(Closed((z0.infimum - len(c) - 0.5 * sqrt(ulp(1.0)), z0.supremum - len(c) + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.infimum - 0.5 * sqrt(ulp(1.0)), z0.supremum + 0.5 * sqrt(ulp(1.0)))))
                    zero_periodized_set.add(Closed((z0.infimum + len(c) - 0.5 * sqrt(ulp(1.0)), z0.supremum + len(c) + 0.5 * sqrt(ulp(1.0)))))
            for o0 in known_opens:
                ss = False
                for z0 in zero_periodized_set:
                    if Open((o0[0], o0[1])) <= z0:
                        ss = True
                        break
                if not ss:
                    return False
            return True
        #---------------
        def sgl_opn_superset_ivl (
            known_singletons,
            known_opens,
            z
        ):
            knowns_periodized_set = set()
            for s0 in known_singletons:
                knowns_periodized_set.add(Closed((s0 - len(c) - 0.5 * sqrt(ulp(1.0)), s0 - len(c) + 0.5 * sqrt(ulp(1.0)))))
                knowns_periodized_set.add(Closed((s0 - 0.5 * sqrt(ulp(1.0)), s0 + 0.5 * sqrt(ulp(1.0)))))
                knowns_periodized_set.add(Closed((s0 + len(c) - 0.5 * sqrt(ulp(1.0)), s0 + len(c) + 0.5 * sqrt(ulp(1.0)))))
            for o0 in known_opens:
                knowns_periodized_set.add(Closed((o0[0] - len(c) - 0.5 * sqrt(ulp(1.0)), o0[1] - len(c) + 0.5 * sqrt(ulp(1.0)))))
                knowns_periodized_set.add(Closed((o0[0] - 0.5 * sqrt(ulp(1.0)), o0[1] + 0.5 * sqrt(ulp(1.0)))))
                knowns_periodized_set.add(Closed((o0[0] + len(c) - 0.5 * sqrt(ulp(1.0)), o0[1] + len(c) + 0.5 * sqrt(ulp(1.0)))))
            knowns_periodized_set = Interval.union(knowns_periodized_set)
            for z0 in z:
                ss = False
                for o0 in knowns_periodized_set:
                    if z0 <= o0:
                        ss = True
                        break
                if not ss:
                    return False
            return True
