            if len(known_zc) != len(test_zc):
                return [float("inf")]
            least_known_wrt_test = []
            for t0 in range(len(test_zc)):
                zc = (test_zc[t0].midpoint % period) % period
                least = (
                    (t0, 0, abs(zc - (known_zc[0] % period) % period))
                        if isinstance(known_zc[0], float)
                        else (t0, 0, abs(zc - ((0.5 * (known_zc[0][0] + known_zc[0][1])) % period) % period))
                )
                for k0 in range(1, len(known_zc)):
                    e = (
                        abs(zc - (known_zc[k0] % period) % period)
                            if isinstance(known_zc[k0], float)
                            else abs(
                                zc - ((0.5 * (known_zc[k0][0] + known_zc[k0][1])) % period) % period)
                    )
                    least = least if least[-1] < e else (t0, k0, e)
                least_known_wrt_test.append(least)
            least_test_wrt_known = []
