        for test in known_zero_crossings_unit_multiplicitys:
            degree = test[0]
            delay = test[1]
            data = test[2]
            # multiplicity = test[3]
            # imposed_zeros = test[4]
            known_ascending = test[5]
            known_descending = test[6]
            c = np.array(data, dtype = "float")
            known_ps = PeriodicSpline1D.from_spline_coeff(c, degree = degree, delay = delay)
            zc = known_ps.zero_crossings()
            assert 2 == len(zc)
            assert len(known_descending) == len(zc[0])
            assert len(known_ascending) == len(zc[1])
            assert isclose(
                0.0,
                max(_least_abs_zero_crossings_unit_multiplicity_error(known_descending, zc[0], len(c))),
                rel_tol = sqrt(ulp(1.0)),
                abs_tol = sqrt(ulp(1.0))
            )
            assert isclose(
                0.0,
                max(_least_abs_zero_crossings_unit_multiplicity_error(known_ascending, zc[1], len(c))),
                rel_tol = sqrt(ulp(1.0)),
                abs_tol = sqrt(ulp(1.0))
            )

