    def test_extrema_degree0 (
        self
    ):
        #---------------
        def _least_abs_extrema_degree0_error (
            known_ex, # [[lb, ub], extremum]
            test_ex, # [Extremum<domain, value>]
            period
        ):
            if 0 == len(known_ex) or 0 == len(test_ex):
                return ([], [])
            least_known_wrt_test = []
            for t0 in range(len(test_ex)):
                ex = (test_ex[t0].domain.midpoint % period) % period
                least = (t0, 0, float("inf"), float("inf"))
                for k0 in range(len(known_ex)):
                    e = abs(ex - ((0.5 * (known_ex[k0][0][0] + known_ex[k0][0][1])) % period) % period)
                    least = least if least[-2] < e else (t0, k0, e, abs(test_ex[t0].value - known_ex[k0][1]))
                least_known_wrt_test.append(least)
            least_test_wrt_known = []
            for k0 in range(len(known_ex)):
                ex = ((0.5 * (known_ex[k0][0][0] + known_ex[k0][0][1])) % period) % period
                least = (0, k0, float("inf"), float("inf"))
                for t0 in range(len(test_ex)):
                    e = abs(((test_ex[t0].domain.midpoint % period) % period) - ex)
                    least = least if least[-2] < e else (t0, k0, e, abs(test_ex[t0].value - known_ex[k0][1]))
                least_test_wrt_known.append(least)
            least = ([], [])
            if len(least_test_wrt_known) < len(least_known_wrt_test):
                for tk in least_test_wrt_known:
                    for kt in least_known_wrt_test:
                        if kt[0] == tk[0] and kt[1] == tk[1]:
                            least[0].append(tk[2])
                            least[1].append(tk[3])
            else:
                for kt in least_known_wrt_test:
                    for tk in least_test_wrt_known:
                        if kt[0] == tk[0] and kt[1] == tk[1]:
                            least[0].append(kt[2])
                            least[1].append(kt[3])
            return least
