        for test in known_extremas:
            degree = test[0]
            delay = test[1]
            data = test[2]
            known_minima = test[3]
            known_maxima = test[4]
            c = np.array(data, dtype = "float")
            known_ps = PeriodicSpline1D.from_spline_coeff(c, degree = degree, delay = delay)
            known_sglt_minima = [
                (
                    Singleton(m[0][0]
                        if m[0][0] == m[0][1]
                        else 0.5 * (m[0][0] + m[0][1])),
                    m[1]
                )
                for m in known_minima if isclose(
                    m[0][0],
                    m[0][1],
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            ]
            known_sglt_maxima = [
                (
                    Singleton(m[0][0]
                        if m[0][0] == m[0][1]
                        else 0.5 * (m[0][0] + m[0][1])),
                    m[1]
                )
                for m in known_maxima if isclose(
                    m[0][0],
                    m[0][1],
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            ]
            known_clsd_minima = [
                (
                    Closed((m[0][0], m[0][1])),
                    m[1]
                )
                for m in known_minima if not isclose(
                    m[0][0],
                    m[0][1],
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            ]
            known_clsd_maxima = [
                (
                    Closed((m[0][0], m[0][1])),
                    m[1]
                )
                for m in known_maxima if not isclose(
                    m[0][0],
                    m[0][1],
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            ]
            ex = known_ps.extrema()
            assert 2 == len(ex)
            assert len(known_sglt_minima) + len(known_clsd_minima) == len(ex[0])
            assert len(known_sglt_maxima) + len(known_clsd_maxima) == len(ex[1])
            least_sglt_min = _least_abs_extrema_sglt_error(known_sglt_minima, ex[0], len(c))
            least_sglt_max = _least_abs_extrema_sglt_error(known_sglt_maxima, ex[1], len(c))
            least_clsd_min = _least_abs_extrema_clsd_error(known_clsd_minima, ex[0], len(c))
            least_clsd_max = _least_abs_extrema_clsd_error(known_clsd_maxima, ex[1], len(c))
            if 0 < len(least_sglt_min[0]):
                assert isclose(
                    0.0,
                    max(least_sglt_min[0]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_sglt_min[1]):
                assert isclose(
                    0.0,
                    max(least_sglt_min[1]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_sglt_max[0]):
                assert isclose(
                    0.0,
                    max(least_sglt_max[0]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_sglt_max[1]):
                assert isclose(
                    0.0,
                    max(least_sglt_max[1]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_clsd_min[0]):
                assert isclose(
                    0.0,
                    max(least_clsd_min[0]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_clsd_min[1]):
                assert isclose(
                    0.0,
                    max(least_clsd_min[1]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_clsd_max[0]):
                assert isclose(
                    0.0,
                    max(least_clsd_max[0]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
            if 0 < len(least_clsd_max[1]):
                assert isclose(
                    0.0,
                    max(least_clsd_max[1]),
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )

