            data = test[2]
            nu = test[3]
            known_fourier_coeff = test[4]
            c = np.array(data, dtype = "float")
            ps = PeriodicSpline1D.from_spline_coeff(c, degree = degree, delay = delay)
            for (k, nu0) in enumerate(nu):
                assert isclose(
                    known_fourier_coeff[k].real,
                    ps.fourier_coeff(nu0).real,
                    rel_tol = sqrt(ulp(1.0)),
                    abs_tol = sqrt(ulp(1.0))
                )
