        for test in known_piecewise_spline_unit_multiplicitys:
            degree = test[0]
            delay = test[1]
            data = test[2]
            # multiplicity = test[3]
            # imposed_zeros = test[4]
            known_sgns = test[5]
            known_singletons = [s for s in known_sgns if not isinstance(s[0], list)]
            known_opens = [s for s in known_sgns if isinstance(s[0], list)]
            c = np.array(data, dtype = "float")
            known_ps = PeriodicSpline1D.from_spline_coeff(c, degree = degree, delay = delay)
            sgns = known_ps.piecewise_sgn()
            assert(known_ps.period == sgns.period)
            for p in sgns.pieces:
                if isinstance(p.domain, Singleton):
                    assert _found_matching_singleton(p, known_singletons, known_ps.period)
                else:
                    assert _found_matching_interval(p, known_opens, known_ps.period)
        pass

